import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
// import App from './App';

const root = ReactDOM.createRoot(document.getElementById("root"));

const AppList = () => {
    const items = [
        "Мой первый компонент",
        "Мой второй компонент"
    ]
}

const AppHeader = () => {
    return (<h1><span>Hello World!!</span></h1>);
}

const App = () => {
    return (
        <>
            <AppHeader/>;
            <AppList/>
        </>
    )
}

root.render(<App/>);
